<span class="line"><span style="color:#A6ACCD;">report_addr </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;&quot;</span><span style="color:#A6ACCD;"> </span><span style="color:#676E95;font-style:italic;"># 告警信息推送地址，业务可以实现对应接口，实现自定义告警通知</span></span>
